INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<p><img alt="keyboard" src="/groupsite/sites/default/images/keyboard_500px.jpg" style="float:left" />&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;We are Karrot Designs. We design interactive and cutting edge websites. If you are a person, group, or business looking to improve and expand your name or brand, you’ve found the right place! We specialize in modern, responsive, and professional designs that meet today’s web standards. Whether you are looking for a branding update or a complete revision of your website, we are here to help. With our crack team of Developers and Designers, Karrot Designs can promise no less than top-notch work and speedy success in your websites future. Our company provides the services and help needed to bring you above the competition.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;Our Team consists of Dylan Keefer, Matthew Tomich, and Sheldon Davis. Dylan Keefer is Karrot Designs web designer, with his wide array of skills with the coding languages you can have the nicest looking site around. Matthew Tomich is the web developer of the team, his knack for functionality and interactivity will bring your site to life. Project manager, Sheldon Davis, oversees all aspects of the website building process to ensure that the website reflects your business and your purpose. We have all graduated together from Pittsburgh Technical Institute and decided to go into business for ourselves, and such was the birth of Karrot Designs. Each member of the team comes from a very diverse background and have some unique skills of our own to provide our clients with the best possible product. With Karrot Designs’ skills a great website is a simple email or phone call away. So, become web present!</p>\r\n', 'Index page', 'full_html'),
(2, '<p><strong><img alt="" src="/groupsite/sites/default/images/sheldon_profile_500px.jpg" style="float:left" /></strong></p>\r\n\r\n<p><strong>Name:&nbsp;</strong>Sheldon Davis</p>\r\n\r\n<p>Hello! I am Sheldon Davis, Project Manager for Karrot Designs. I took the role of Project manager, because I like being able to see the site from all angles and have input on almost all aspects of the sites we built. I have a background in front and back end web design, along with a love for anything interactive. I have graduated from Pittsburgh Technical Institute with an Associate in Science Degree in Multimedia Technologies. I have skills with a wide variety of programs and languages, including Javascript, HTML5/CSS3, PHP, Drupal, WordPress, and The Adobe Suite. I live to create and work with websites.&nbsp;</p>\r\n\r\n<p><strong>Email Sheldon:&nbsp;</strong><a href="mailto:sheldon.davis1515@gmail.com">sheldon.davis1515@gmail.com</a></p>\r\n', 'Sheldon''s Bio', 'full_html'),
(3, '<p><strong><img alt="" src="/groupsite/sites/default/images/matt_profile_500px.jpg" style="float:left" /></strong></p>\r\n\r\n<p><strong>Name:&nbsp;</strong>Matthew Tomich</p>\r\n\r\n<p>I am a <strong>front-end web developer and designer</strong> who has a passion for coding, designing, and learning new techniques to create innovative websites. Over the past couple of years, I have refined my developer skills with <strong>HTML5</strong><strong>, <strong>CSS3</strong></strong>, and <strong>Javascript</strong>, while improving my skills with <strong>JQuery,</strong><strong> <strong>PHP</strong>, <strong>MySQL</strong>, <strong>XML</strong>, <strong>JSON</strong>, <strong>WordPress</strong>,</strong> and Drupal.&nbsp; Also, I am very comfortable with graphic design in the Adobe Software Suite.&nbsp; This includes Adobe Illustrator, Photoshop, After Effects, and InDesign.</p>\r\n\r\n<p>I have recently obtained my <strong>Associate in Science Degree</strong> in Multimedia Technologies with a concentration in <strong>Web and Interactive Design</strong> from Pittsburgh Technical Institute. From school and from hands-on experience, I have gained abilities with <strong>responsive web design</strong><strong>, <strong>front-end web development</strong></strong>, and<strong> <strong>back-end web development that helps Karrot Designs build interactive projects</strong>.</strong></p>\r\n\r\n<p><strong>Email Matt:&nbsp;</strong><a href="mailto:Mmt8@students.pti.edu">Mmt8@students.pti.edu</a></p>\r\n', 'Matt''s Bio', 'full_html'),
(4, '<p><img alt="" src="/groupsite/sites/default/images/dylan_profile_500px.jpg" style="float:left" /></p>\r\n\r\n<p><strong>Name:&nbsp;</strong>Dylan Keefer</p>\r\n\r\n<p>My name is Dylan Keefer. I’m the team designer for Karrot Designs. My favorite part about being the team designer is making web designs from my imagination turn into reality. I graduated from Pittsburgh Technical Institute with an Associate in Science Degree, majoring in Multimedia Technologies with concentration in Web/Interactive Design.</p>\r\n\r\n<p>My areas of expertise are web design and development, digital imaging, and copy writing. I have refined knowledge of languages from HTML5 and CSS3 to languages like PHP, and JavaScript. As the team designer I also make full use of the Adobe Suite. Additionally I am experienced with frameworks such as WordPress, Drupal, and the Twitter’s Bootstrap.</p>\r\n\r\n<p><strong>Email Dylan:&nbsp;</strong><a href="mailto:dylan.keefer@gmail.com">dylan.keefer@gmail.com</a></p>\r\n', 'Dylan''s Bio', 'full_html'),
(5, '<p>&copy;Karrot Designs</p>\r\n', 'copyright', 'full_html'),
(6, '<p>Karrot Designs is here to help you. If you have any questions concerning our services, or if you want to contact us for a quote; please fill out the contact information, and we will reply as soon as possible.</p>\r\n\r\n<p><strong>Karrot Designs</strong></p>\r\n\r\n<p><strong>Email:</strong> KarrotDesigns@mail.com</p>\r\n\r\n<p><strong>Phone:</strong> 555-555-5555</p>\r\n\r\n<p><a href="http://www.karrotdesigns.com/">www.karrotdesigns.com</a></p>\r\n\r\n<p>Monday – Friday 9:00am – 5:00pm EST</p>\r\n\r\n<p><strong>Address:</strong> 515 Karrot Drive</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Dylan Keefer</p>\r\n\r\n<p>Team Web Designer</p>\r\n\r\n<p><strong>Email:</strong>&nbsp;<a href="mailto:Mmt8@students.pti.edu">drk6@students.pti.edu</a></p>\r\n\r\n<p><strong>Phone:</strong> 555-555-5555</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Matt Tomich</p>\r\n\r\n<p>Team Web Developer</p>\r\n\r\n<p><strong>Email:</strong>&nbsp;<a href="mailto:Mmt8@students.pti.edu">Mmt8@students.pti.edu</a></p>\r\n\r\n<p><strong>Phone:</strong>&nbsp;555-555-5555</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Sheldon Davis</p>\r\n\r\n<p>Team Project Manager</p>\r\n\r\n<p><strong>Email:</strong> sheldon.davis1515@gmail.com</p>\r\n\r\n<p><strong>Phone:</strong> 555-555-5555</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'contact us', 'filtered_html'),
(7, '<p><strong>Web Design</strong></p>\r\n\r\n<p>At Karrot Design we offer custom web design that will both represent the feel of your company. We know how the construction and organization of your website will influence both usability and perceived relevance. With additions like call to action buttons and search features, your website design or redesign will be able to more effectively guide users to the information or purchases they set out to find. Company websites are a vital marketing tool. To suit all of our diverse clients with their unique goals and brand images, we produce customized design solutions to meet every new challenge. With this approach of client-oriented design, we are better able to achieve attractive and cohesive website design. It also enables us to integrate our clients'' goals and message into the process from the initial phases of design. Starting with a clear purpose is the best way to ensure greater conversions later on.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Web Development</strong></p>\r\n\r\n<p>Every website we develop is programmed using the latest HTML 5 and CSS3 standards. HTML 5 has shifted the emphasis of certain areas over others on a web page. This helps draw a search engine''s attention to the more important and relevant sections of your page, which may help boost your page rankings. CSS is a web-based markup language that dictates the look and styling of a web page to the browser. CSS3 is the most recent evolution within the series. To achieve fluid and dynamic movement, we use jQuery, an open source, multi-browser JavaScript library. With CSS and jQuery, we can customize a look to specifically suit your brand and appeal to your audience.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Responsive Web Development</strong><br />\r\n&nbsp;</p>\r\n\r\n<p>Put simply, responsive website design means that there is one site for every screen. Done right, you don’t need a website for your desktop users, your mobile phone users, your iPad users…and the list goes on.&nbsp;Regardless of screen resolution, your responsive website can be seen the way it’s supposed to be seen since it automatically adjusts accordingly.&nbsp;Responsive website design and development has been around for a few years, but not all web developers make it a priority, especially those developers who rely on website templates.&nbsp;Don’t skip this step. As you embark on a new website project or if you’re contemplating whether now is the time for a new website design, take into serious consideration whether or not your site is responsive. It needs to be, and Karrot Design is here to help.</p>\r\n', 'service', 'filtered_html');
